def find_primes_between_indices(numbers):
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    primes = [n for n in numbers[80:85] if is_prime(n)]
    primes.sort(reverse=True)

    return primes
